$(function(){
  $(document).foundation();
  $(document).confirmWithReveal();

  const modal_holder_selector = '#modal';
  const modal_selector = '.reveal';

  $(document).on('click', 'a[data-modal]', function() {
    $.blockUI({
        message: 'Please wait...',
        baseZ: 2000,
        css: {
          border: 'none',
          margin: 0,
          padding: '15px',
          fontSize: 'large',
          backgroundColor: '#000',
          '-webkit-border-radius': '10px',
          '-moz-border-radius': '10px',
          opacity: .5,
          color: '#fff',
          cursor: 'wait'
        }
      });

    const location = $(this).attr('href');
    $.get(
      location,
      data => {
        $.unblockUI()
        new Foundation.Reveal($(modal_holder_selector).html(data).find(modal_selector)).open()
      }
    );
    return false;
  });

});
